import { Fragment } from "react";
import ToDoItem from "./ToDoItem";

const TodoList = (props) => {

    console.log(props.todos)
  const Dummy = props.todos.map(todo => (
    <ToDoItem key={todo.id} activity={todo.activity} />
  ));

  console.log(Dummy)

  return (
    <Fragment>
      <ul>{Dummy}</ul>
    </Fragment>
  );
};

export default TodoList;
